import Layout from '../components/Layout'
import Toolbar from '../components/Toolbar'

const Index = () => {
	return (
		<Layout>
			<div>
				<Toolbar />
				<h1>Welcome to DemoApp using Next.js</h1>
			</div>
		</Layout>
	)
}

export default Index
